import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function Home() {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col xs lg="6">
          <Card className="mt-5">
            <Card.Body>
              <Card.Title className="text-center">
                <h1>CHAIRS</h1> {/* 로고 텍스트 */}
              </Card.Title>
              <Card.Title>Your AI, Made by Everyone</Card.Title>{" "}
              {/* 웹 페이지 제목 */}
              <Card.Text>
                A platform where all users contribute to train the AI. Share
                your knowledge and experiences with the AI. AI provides answers
                to various questions based on learned information. A space for
                users to freely ask any questions. Experience a new way of
                learning and sharing knowledge. A community-driven AI service
                for everyone, by everyone.
              </Card.Text>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
